import React from "react";
import "./Upgrade.css";
import Header from "../Workplace/Header";

function Upgrad() {
    return (
        <div>
            <Header />
            <div>
                <div className="pricing">
                    <h1 className="developer">Developer</h1>
                    <h1 className="preview">Preview</h1>
                </div>
                <div className="pricing_version">
                    <h1 className="version">Version</h1>
                </div>
            </div>
            <Pane
                style={elem}
                className="space"
                onClick={() => {
                    history.push("/dashboard");
                }}
            >
                <Popover
                    position={Position.BOTTOM_LEFT}
                    minWidth={50}
                    content={
                        <Menu>
                            <Menu.Group>
                                <Menu.Item onSelect={() => setIsShown3(true)} style={menu}>
                                    <p className="menucontent">Rename space</p>
                                </Menu.Item>
                                <Menu.Item onSelect={() => setIsShown(true)}>
                                    <p className="menucontent">Share</p>
                                </Menu.Item>
                                <Menu.Item onSelect={() => setIsShown2(true)}>
                                    <p className="menucontent">Move space</p>
                                </Menu.Item>
                                <Menu.Item>
                                    <p className="menucontent">Duplicate</p>
                                </Menu.Item>
                                <Menu.Item onSelect={() => setIsShown1(true)} intent="danger">
                                    <p className="menucontentred">Delete</p>
                                </Menu.Item>
                            </Menu.Group>
                        </Menu>
                    }
                >
                    <MoreIcon className="more_home" />
                </Popover>
            </Pane>
        </div>
    );
}

export default Upgrad;
